import { useSelector, useDispatch } from "react-redux"
import * as actions from '../../redux/users/users-action'
import * as selectors from '../../redux/users/user-selector'





export default function FavoriteCard() {
    const card  = useSelector(selectors.getState);
    const dispatch = useDispatch()

    const handleClose = (id) => {
        dispatch(actions.deleteRepositoriesSuccess(id))
        console.log(handleClose)
    }
    return <>
        <button type='button' onClick={() => handleClose()}></button>
        </>
};
